import { useState } from "react";
import "./App.css";
import InputTodo from "./components/InputTodo/InputTodo";

function App() {
  const [todo, setTdod] = useState([]);

  return (
    <div className="App">
      <InputTodo todo={todo} setTdod={setTdod} />
    </div>
  );
}

export default App;
